bio:
The purpose of this channel is to discuss the symbolism found in mythology, with a focus on European Paganism. I wish to discover the ancestral wisdom hidden in these mythologies while sharing the way that I integrate such wisdom into my life through gardening, fitness, homesteading, crafting, music, parenting, brewing, and more.
Come with me on a journey to see our roots which have been severed;
With courage and kindness, wisdom and strength, they'll grip the waiting ground;
Then, again, our spirits will soar on into the ether:
The golden apples of the sun are waiting to be found!
